import React, { useState, useEffect } from 'react';
import { Container, Typography, Box, Button, Card, CardContent, Alert } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import ApiService from '../../services/api';

const Dashboard = () => {
  const navigate = useNavigate();
  const [dashboardData, setDashboardData] = useState(null);
  const [staffList, setStaffList] = useState([]);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      const [dashboard, staff] = await Promise.all([
        ApiService.getDashboard(),
        ApiService.getStaffList()
      ]);
      setDashboardData(dashboard);
      setStaffList(staff);
    } catch (error) {
      setError(error.message || 'Failed to load dashboard data.');
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  if (loading) {
    return (
      <Container>
        <Box sx={{ mt: 4, textAlign: 'center' }}>
          <Typography>Loading...</Typography>
        </Box>
      </Container>
    );
  }

  return (
    <Container maxWidth="lg">
      <Box sx={{ mt: 4 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 4 }}>
          <Typography variant="h4">Dashboard</Typography>
          <Button variant="outlined" onClick={handleLogout}>
            Logout
          </Button>
        </Box>

        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        <Box sx={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: 3, mb: 4 }}>
          <Card>
            <CardContent>
              <Typography variant="h6">Total Staff</Typography>
              <Typography variant="h4">{staffList.length}</Typography>
            </CardContent>
          </Card>
          {dashboardData && (
            <>
              <Card>
                <CardContent>
                  <Typography variant="h6">Company</Typography>
                  <Typography variant="h6">{dashboardData.company_name}</Typography>
                </CardContent>
              </Card>
            </>
          )}
        </Box>

        <Box sx={{ display: 'flex', gap: 2, mb: 4 }}>
          <Button variant="contained" onClick={() => navigate('/add-staff')}>
            Add Staff
          </Button>
        </Box>

        <Typography variant="h6" gutterBottom>Recent Staff</Typography>
        <Box sx={{ display: 'grid', gap: 2 }}>
          {staffList.slice(0, 5).map((staff) => (
            <Card key={staff.id}>
              <CardContent>
                <Typography variant="h6">
                  {staff.firstname} {staff.lastname}
                </Typography>
                <Typography color="textSecondary">
                  {staff.position} - {staff.department}
                </Typography>
                <Typography variant="body2">
                  {staff.email}
                </Typography>
              </CardContent>
            </Card>
          ))}
        </Box>
      </Box>
    </Container>
  );
};

export default Dashboard;
